export default function Dropdown(listArray, cName) {
    return (
        <div className={`${cName}`}>
            {listArray.map((item) => {
                return (
                    <>
                    <a href={item.path}>{item.title}</a>
                    </>
                )
            })}

            {listArray.length  ? <hr/> : null}
        </div>
    )
}
